import * as types from "./types";

export const authLogin = (payload) => {
    return {
        type: types.STEAM_LOGIN,
        payload
    }
}


export const authLogout = (payload = null) => {
    return {
        type: types.STEAM_LOGIN,
        payload
    }
}
